import AddItem from './item/AddItem';
import AddWeekly from './item/AddWeekly';


const Sidebar = () => {

    return (
        <div className='sidebar'>
            <div className='sidebar__title'>
                <h2>Add Item</h2>
                <hr />
            </div>
            <AddItem />
            <div className='sidebar__title pt-2'>
                <h2>Add Item Weekly</h2>
                <hr />
            </div>
            <AddWeekly />
        </div>
    );
};

export default Sidebar;
